#ad Marking yesterday as one of the most inspirational and most memorable days. Yesterday, our family had the honor of being a part of ZYRTEC® ReLEAF Project, in partnership with American Forests! So, we planted trees to help increase tree equity and foster a better and healthier planet. This was not only important for Detroit, but important for us to teach our daughters that spreading love and kindness and nurturing the community around us is so important. Thank you @zyrtecallergy and @americanforests for inviting us to be a part of this wonderful project.

@thegreeningofdetroit @detroittreeequity

